import React from 'react'
import Source from '../../assets/slide-1.jpg'

import {
    Container,
    BackgroundContainer,
    Image
} from './styled'

const BackgroundImages = () => {

    const renderDiv = (extraClass) => {
        let item = [];
        for (let i = 0; i < 4; i++) {
          item.push(
            <BackgroundContainer 
              key={ i }
            >
                <Image src={Source}/>
            </BackgroundContainer> 
          );
        }
        return item;
    };

    return (
        <Container>
            {renderDiv()}
        </Container>
    )
}


export default BackgroundImages;
